import React, { useState } from 'react';
const Todo = ({addTodo})=>{
    const[value , setValue] = useState ('')

    const handleSubmit =(e) => {
        e.preventDefault();
        if (!value) return;
        addTodo(value);
        setValue ('')
    };
    return (
        <form onSubmit={handleSubmit}>
            <input
            type='text'
            value={value}
            onChange={(e) =>
            setValue(e.target.value)}
            placeholder='add not'/>
            <button type='submit'>add</button> 
        </form>
    );
};




 export default Todo;
